import React from 'react'
import Nav from './Nav'
import {Taka,Stars,Like,Filter} from "./Components"
const  Searched = ({search}) => {
	return (
		<>
        <div className="searched-page">
        	<Nav stick={true} ase={true} searchon={true} visible={true} colour={'ash'}></Nav>




         <Results results={search} >

         </Results>
        </div> 
		</>
	)
}
const Results=({results})=>{
	let url = 'http://127.0.0.1:8000'
	return(
		<>

		  <div className="all">
		   <Filter></Filter> 
	       <div className="cards">
	       	  {results.map((result)=>{
	       	  	return(
                   <div className="card">
                   	<img className={`${url+results.image}`} src="images/product6.jpg" alt=""/>
                   	<h1 className="title">
                   		{results.name}
                   	</h1>
                   	<Taka num={"minier"} taka={results.price}  ></Taka>
                   	<Stars></Stars>
                   	<div className="cart-like">
                   		<h1>Add tocart</h1>
                        <Like></Like>
                   	</div>
                   </div>
	       	  	)
	       	  })}
	       </div>	

		  </div>
		</>

	)
}

export default  Searched
